En venant du centre ville, 3 accès à gauche à partir de l'avenue Al Cartero, dans l'ordre  :
- salle multisports, pétanque, tennis couvert (Chemin de Mosqueros);
- fronton, tennis quick, basket, skate, salle d'armes et dojo (portail au début du chemin de Mosqueros); 
- piscine et terrain multisports (après le chateau).
